import Icon from '@mdi/react';
import { mdiHome } from '@mdi/js';

const Navbar = () => {
    return ( 
        <div className="navbar-home">
            <div className="navlink">
                <Icon path={mdiHome} size={1} />
                <p>Home</p>
            </div>
        </div>
     );
}

export default Navbar;
